sys_variable_value.value:
(function execute(inputs, outputs) {

  var body = JSON.parse(inputs.responseBody);
  var list = [];

  // gs.info('last.fm response: ' + inputs.responseBody);

  if (body.hasOwnProperty('similartracks')) {
    if (body.similartracks.hasOwnProperty('track')) {
      for (var i = 0; i < body.similartracks.track.length; i++) {
        var obj = {
          'title' : body.similartracks.track[i].name,
          'artist' : body.similartracks.track[i].artist.name,
          'match' : body.similartracks.track[i].match
        };
        list.push(obj);
      }
    }
  }

  outputs.similar_text = JSON.stringify(list, null, 4);

})(inputs, outputs);

