sys_variable_value.value:
(function execute(inputs, outputs) {

  var myLimit = parseInt(inputs.limit, 10).toFixed(0);
  outputs.limit = (myLimit > 0) ? myLimit : null;

  var autocorrect = (inputs.autocorrect == "true") ? 1 : 0;
  outputs.autocorrect = autocorrect.toFixed(0);

})(inputs, outputs);

